import { API_URL } from "./constants";


async function ApiOauth() {

    // hardcoding api secret for now
    const apiKey = 'cbb79314d13ec7dfff8adedfe8883.782424ee772c73dbb8de1ff0a47ec96d9ac15616b1d679451ec8ac79e65018e9cc0e3301324218fbd15719c14b514f31f'
    const headers = {
        'Content-Type': 'application/json',
        'X-Api-Secret-Key': apiKey
    }

    const response = await fetch(API_URL+'api/v1/app/oauth', {
        method: 'POST',
        headers: headers,
        body: null,
    });

    const resp = await response.json();
    return resp;
}



module.exports = { ApiOauth };
